/* eslint-disable no-console */
/* eslint-disable react/prop-types */
import React, { useEffect } from 'react';
import { withRouter } from 'react-router';

const Redirect = ({ history, location }) => {
  useEffect(() => {
    console.log('hisatory and location', history, location);
  }, [location]);
  return (<iframe width="600px" height="400px" align="center" scrolling="auto" title="redirecting" src="https://accounts.google.com/o/oauth2/v2/auth?access_type=offline&scope=https%3A%2F%2Fwww.googleapis.com%2Fauth%2Fcontacts.readonly&response_type=code&client_id=6808591183-4msj8nlg44stk09uqr8hjrt5itcmks9n.apps.googleusercontent.com&redirect_uri=http%3A%2F%2Flocalhost%3A4000" />);
};

export default withRouter(Redirect);
